import React, {Component} from 'react';

import axios from 'axios';

class Axios extends Component{
    constructor(props){
        super(props)
        this.state = {
            posts : [],
        }
    }

    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/posts')
            .then( response => {
                this.setState({posts : response.data });
            });
    }

    render(){
        return(
            <h1>haii</h1>
        )
    }
}


export default Axios;
